import {
    FETCH_NEWS_SUCCESS,
    FETCH_NEWS_FAILURE
} from 'actionsType'

const initialState = [
]

export default (state = initialState, {type, payload})=>{
    switch (type){

        case FETCH_NEWS_SUCCESS:
            return payload
        case FETCH_NEWS_FAILURE:
            return payload
        default:
            return state
    }

}